from typing import List
class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        dp=[[1e5]*len(mat[0]) for i in range(len(mat))]
        print(len(mat))
        #initalize
        for i in range(len(mat)):
            for j in range(len(mat[0])):
                if mat[i][j]==0:
                    dp[i][j]=0
        #update
        update=1
        while update>0:
            update=0
            for i in range(len(mat)):
                for j in range(len(mat[0])):
                    if dp[i][j]>=1:
                        #left
                        if j-1>=0 and dp[i][j-1]+1<dp[i][j]:
                            dp[i][j]=dp[i][j-1]+1
                            update=update+1
                        #right
                        if j+1<=len(dp[0])-1 and dp[i][j+1]+1<dp[i][j]:
                            dp[i][j]=dp[i][j+1]+1
                            update=update+1
                        #up
                        if i-1>=0 and dp[i-1][j]+1<dp[i][j]:
                            dp[i][j]=dp[i-1][j]+1
                            update=update+1
                        #down
                        if i+1<=len(dp)-1 and dp[i+1][j]+1<dp[i][j]:
                            dp[i][j]=dp[i+1][j]+1
                            update=update+1
            print(update)
        return dp



